import React from 'react';



class PopUp extends React.Component {
    render() {
        return (
            <div className="container mt-3" className="popUp"> 
                <h2 className="text-center" >Do you want to Save the Playlist to your Spotify account?</h2>
                <div className="btn-block mt-4 text-center">
                    <a className="btn btn-primary mr-4" onClick={this.props.onSave}>SAVE</a>
                    <a className="btn btn-info mr-4" onClick={this.props.onChoose}>NOT YET</a>
                </div>
            </div>

        )
    }
}

export default PopUp;
